import Estudante from "./Estudante";
import {Button} from './TurmaStyled';

function Turma(props) {
  return (
    <div>
      <h1>Turma {props.turma}</h1>
      <h4>Respons√°vel:{props.responsavel}</h4>
      <Bu onClick={props.apresentar}><Button>Apresentar</Button></Bu>

      <Estudante
        nome={"Clarinha"}
        idade={40}
        corDaRoupa={"preta"}
        criadoPor={props.responsavel}
      />
      <Estudante
        nome={"Marcelo"}
        idade={25}
        corDaRoupa={"azul"}
        criadoPor={props.responsavel}
      />
      <Estudante
        nome={"Luiz"}
        idade={18}
        corDaRoupa={"verde"}
        criadoPor={props.responsavel}
      />
      <Estudante
        nome={"Muri"}
        idade={39}
        corDaRoupa={"amarelo"}
        criadoPor={props.responsavel}
      />
    </div>
  );
}

export default Turma;
